#!/usr/bin/env pypy3

# mega-carp solution

def react(s):
    st = s
    def find_reduction():
        nonlocal st
        f = []
        i = 0
        last_contiguous = 0
        while i < len(st)-1:
            if st[i+1] != st[i] and st[i+1].upper() == st[i].upper():
                f.append(st[last_contiguous:i])
                i += 2
                last_contiguous = i
            else:
                i += 1
        f.append(st[last_contiguous:])
        st = "".join(f)
        return len(f) > 1
    while find_reduction():
        pass
    return st

foo = "dabAcCaCBAcCcaDA"

foo2 = ""

def react2(foo):
    lst = []
    for i in range(ord('A'), ord('Z')+1):
        c = chr(i)
        v = (c, len(react(foo.replace(c, '').replace(c.lower(), ''))))
        lst.append(v)
        print("ping.")
    lst.sort(key=lambda key: key[1])
    return lst[0]

print(react2(foo2))
